import React from 'react';

const products = [
  {
    id: 1,
    name: 'Product 1',
    price: '$24.99',
    imageUrl: 'https://images.unsplash.com/photo-1609710219171-f86ae613c8d8?q=80&w=1935&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D',
  },
  {
    id: 2,
    name: 'Product 2',
    price: '$49.99',
    imageUrl: 'https://via.placeholder.com/200',
  },
  {
    id: 3,
    name: 'Product 3',
    price: '$9.99',
    imageUrl: 'https://via.placeholder.com/200',
  },
  // Add more products as needed
];

const StorePage = () => {
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Hero Section */}
      <div className="bg-blue-600 text-white p-12 text-center">
        <h1 className="text-4xl font-bold mb-4">Welcome to Our Store</h1>
        <p>Explore our wide range of products and find your best fit!</p>
      </div>

      {/* Product Cards */}
      <div className="container mx-auto px-4 py-8">
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
          {products.map((product) => (
            <div key={product.id} className="bg-white shadow-lg rounded-lg overflow-hidden">
              <img src={product.imageUrl} alt={product.name} className="w-full h-56 object-cover object-center"/>
              <div className="p-4">
                <h3 className="font-bold text-xl mb-2">{product.name}</h3>
                <p className="text-gray-700">{product.price}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default StorePage;
